import React from 'react';
import Appbar from '../surface/Appbar';
import ContactSection from './ContactSection';
import AboutSection from './AboutSection';


function Dashboard() {

  return (
    <div>
      <Appbar/>
      <HomeSect/>
      <AboutSection/>
      <ContactSection/>
    </div>
  );
}

export default Dashboard;
